import './App.scss';
import Nav from './component/Navigation/Nav';
import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route
} from "react-router-dom";

function App() {
  return (
    <Router>
    <div className='app-container'>
      <Nav/>
      <Switch>
          <Route path="/new">
          new
          </Route>
          <Route path="/about">
            about
          </Route>
          <Route path="/contact">
            contact
          </Route>
          <Route path="/">
           HOme
          </Route>
        </Switch>
    </div>
    </Router>
  )
}

export default App;
